import styles from "./Navigation.module.css";

const ListItem = ({ title }) => {
  return <li className={styles.list}>{title}</li>;
};

const list = ["Home", "Investments", "Who are we", "Conatct Us"];

const Navigation = () => {
  return (
    <>
      <nav>
        <ul className={styles.lists}>
          list.map(el => {})
          <ListItem title="Home" />
        </ul>
      </nav>
    </>
  );
};

export default Navigation;
